import React from 'react'
import { FormGenerator } from '@steera/form-manager';

export default function Generator() {
  const onExport = (arg) => {
    console.log('FormData', arg);
  };

  return (
    <FormGenerator

      name='myform'
      onExport={onExport}
    />
  );
}
